<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>PRISH logo</title>
    <style>
        #preloader{
            justify-content: center;
            margin-top: 300px;
            align-content: center;

            width: 100%;
            height: 100%;
            position: absolute;
            top: 0;
            left: 0;
            background-color: #fff;
            z-index: 10000;
            overflow: hidden;
        }
        .preloader-logo{
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%,-50%);
        }

        #Dubai{
            transform-origin: top center;
            animation: dropAndSlide 1s ease-in-out;

        }
        @keyframes dropAndSlide {
      0% {
        transform: translateY(-100%);
        opacity: 0;
      }
      50% {
        transform: translateY(0);
        opacity: 1;
      }
      100% {
        transform: translateY(0);
        opacity: 1;
      }
    }

    #Letters{
            transform-origin: top center;
            animation: dropAndSlide 1s ease-in-out;

        }
        @keyframes dropAndSlide {
      0% {
        transform: translateY(-10%);
        opacity: 1;
      }
      50% {
        transform: translateY(-100%);
        opacity: 1;
      }
      100% {
        transform: translateY(0);
        opacity: 0;
      }
    }
    </style>
</head>
